const sanitize_spaces_1=require("./sanitize-spaces");exports.parseCmd=({cmd})=>{let cmdStr;let cmdArgs=[];if(Array.isArray(cmd)){cmdStr=cmd[0];if(cmd.length>1)cmdArgs=cmdArgs.concat(cmd.slice(1,cmd.length))}else{const cmdSanitized=sanitize_spaces_1.sanitizeSpaces(cmd);const cmdArr=cmdSanitized.split(" ");cmdStr=cmdArr[0];if(cmdArr.length>1)cmdArgs=cmdArgs.concat(cmdArr.slice(1,cmd.length))}return{cmd:cmdStr,cmdArgs}};